define([
  'shared/util/TemplateUtil',
  'shared/models/BaseModel'
], function (TemplateUtil, BaseModel) {

  var urlTemplate = TemplateUtil.tpl('/api/v1/internal/apps/{{__instanceId__}}/types');

  return BaseModel.extend({

    initialize: function (attrs) {
      attrs || (attrs = {});
      if (!attrs['__instanceId__']) {
        throw 'Cannot initialize AppUserCustomTypePossibleValues without an instance id';
      }
    },

    url: function () {
      return urlTemplate(this.toJSON({verbose: true}));
    }

  });

});
